column61:
Governance activities centered around finalizing/submitting our SOW and budget, as well as coordinating internally to kick off our 2022-23 cycle plan. Activities included:
- Call with engagement counselor and communications counselor (7/13);
- Coordinated call with partner (Association of PAs in Obstetrics and Gynecology) to discuss upcoming collaborative activity - call scheduled for 8/1;
- Set up monthly check-in meetings with internal stakeholders;
- Set up bi-weekly call with engagement counselor;
- Reached out to other partner (Physician Assistant Education Association) to discuss next steps for planning collaborative activities - focus on virtual presentation series to PA programs. Planning kick-off meeting to discuss upcoming collaborative activities.

